import React from 'react';
import { Flex, Button } from "@chakra-ui/core";


export const Header = () => {
    return (
        <Flex h="3rem" pt='2rem' pb='2rem'>
            <Button as="h3" size="md" marginLeft="2rem" variant="ghost">Home</Button>
            <Button as="h3" size="md" marginLeft="2rem" variant="ghost">Learn</Button>
            <Button as="h3" size="md" marginLeft="2rem" variant="ghost">Move on</Button>
            <Button as="h3" size="md" marginLeft="2rem" variant="ghost">Result</Button>
        </Flex>
    )
}
